import React from "react";
import logo from "../logo.svg";
import "./App.css";
import ModelList from "./models/ModelList";
import ModelProfile from "./models/ModelProfile";
import ModelForm from "./models/ModelForm";

function App() {
  return (
    <div className="App">
      <div className="row">
        <div className="col s12">Menu</div>
      </div>
      <div className="row">
        <div className="col s3">ModelList</div>
        <div className="col s9">ModelProfile</div>
      </div>
      <div className="row">
        <div className="col s12">ModelForm</div>
      </div>
    </div>
  );
}

export default App;
